import { useState, useRef, useEffect } from "react";
import Navbar from "../Navbar/Navbar";
import Footer from "../Footer/Footer";
import "../Home/Home.css";
import "./StudyInterface.css";

const StudyTracker = () => {

    const [showAchievements, setShowAchievements] = useState(false);

    const toggleAchievements = () => {
        setShowAchievements((prev) => !prev);
    };

    const [tasks, setTasks] = useState([]);
    const [newTask, setNewTask] = useState("");
    const [showInput, setShowInput] = useState(false);
    const [editIndex, setEditIndex] = useState(null);

    const addTask = () => {
        if (newTask.trim() === "") return;

        if (editIndex !== null) {
            const updatedTasks = [...tasks];
            updatedTasks[editIndex] = { ...updatedTasks[editIndex], text: newTask };
            setTasks(updatedTasks);
            setEditIndex(null);
        } else {
            setTasks([...tasks, { text: newTask, completed: false }]);
        }

        setNewTask("");
    };

    const deleteTask = (index) => {
            setTasks(tasks.filter((_, i) => i !== index));
    };

    const editTask = (index) => {
        setNewTask(tasks[index].text);
        setEditIndex(index);
        setShowInput(true);
    };

    const toggleComplete = (index) => {
        const updatedTasks = [...tasks];
        updatedTasks[index].completed = !updatedTasks[index].completed;
        setTasks(updatedTasks);
    };

    return (

        <div className="tracker-page-container">
            <Navbar />

            <div className="dashboard">
                <div className ="sidebar">
                    <div class="header">
                        To-Do List
                        <button className="add-task-button" onClick={() => setShowInput(!showInput)}>+</button>
                    </div>
                    
                    {showInput && (
                        <div className="todo-input">
                        <input
                        type="text"
                        placeholder="Add a task..."
                        value={newTask}
                        onChange={(e) => setNewTask(e.target.value)}
                        onKeyDown={(e) => e.key === "Enter" && addTask()}
                        />
                        <button onClick={addTask}>Add</button>
                        </div>
                    )}

                    <ul className="todo-list">
                        {tasks.map((task, index) => (
                            <li key={index} className={task.completed ? "completed" : ""}>
                            <input
                                type="checkbox"
                                checked={task.completed}
                                onChange={() => toggleComplete(index)}
                            />
                            <span>{task.text}</span>

                            <div className="task-buttons">
                                <button onClick={() => editTask(index)}>‚úèÔ∏è</button>
                                <button onClick={() => deleteTask(index)}>‚ùå</button>
                            </div>
                            </li>
                        ))}
                    </ul>
                </div>

                <div className="middle-column">
                    <div className="image-container">
                        {/* You can insert an image later here */}
                    </div>
                    <div className="achievements-bar" onClick={toggleAchievements}>
                        Achievements + Statistics
                    </div>
                    {showAchievements && (
                        <div className="achievements-content">
                        {/* Replace this database content later */}
                        <p>‚≠ê You completed 3 Pomodoros today!</p>
                        <p>üìà Your focus time increased by 12%</p>
                        </div>
                    )}
                </div>    

                <div className="widgets">

                <div class="widget calendar-widget">
                    <div class="header">Calendar</div>
                </div>

                <div class="widget pomodoro-widget">
                    <div class="header">Pomodoro</div>
                </div>
                
                
            </div>
            </div>

            <div class="main">
            </div>


            <Footer />

        </div>
    );
};

export default StudyTracker;
